import React from 'react';
import alex from '../alex.jpg'

const Card = () => {
    return (
      <div className="flex items-center justify-center h-screen rounded-lg -my-32 mb-20">
        <div className="max-w-sm rounded overflow-hidden shadow-lg p-20 bg-white">
         <img className="w-full rounded-full shadow-lg border-2 border-gray-50 drop-shadow-2xl brightness-50 hover:brightness-100" src={alex} alt="Random" />
          <div className="px-6 py-4">
            <div className="font-bold text-xl mb-2 text-zinc-800">Alessia Gaudioso</div>
            <p className="text-pink-400 text-base">
            Web Developer<br />
            Writer
            </p>
          </div>
          <div className="px-6 py-4">
            <h1>Built with:</h1>
            <span className="inline-block bg-primarypink rounded-full px-3 py-1 text-sm font-semibold text-gray-50 m-2">ReactJS</span>
            <span className="inline-block bg-primarypink rounded-full px-3 py-1 text-sm font-semibold text-gray-50">Tailwind CSS</span>
          </div>
        </div>
      </div>
      
    );
  };
  
  export default Card;
